app.component('kswDatepicker', {
    bindings: {
      options: '=',
      startOrEnd: '@'
    },
    templateUrl: 'datePicker.html',
    controller: function($rootScope, $scope, $filter) {
      this.format = 'dd.MM.yyyy';
      this.altInputFormats = ['dd.MM.yyyy'];

      this.popup1 = {
       opened: false
      };

      this.open1 = function() {
        this.popup1.opened = true;
      };

      this.dateOptions = {
        formatYear: 'yy',
        maxDate: new Date(2020, 5, 22),
        minDate: new Date(),
        showWeeks: false,
        startingDay: 1
      };

      this.dateChanged = function () {
        var date = $filter('date')(this.dt, "yyyy-MM-dd");

        if(this.startOrEnd == 'start') {
          this.options.startDate = date;
        } else if(this.startOrEnd == 'startComp') {
          this.options.startDateComp = date;
        } else {
          this.options.endDate = date;
        }

        console.log(this.options);

      }

      var vm = this;
      var resetListener = $rootScope.$on('resetData', function () {
        vm.dt = '';
      });

      $scope.$on('$destroy', resetListener);

    }
});

app.component('kswType', {
    bindings: {
      options: '='
    },
    templateUrl: 'typeDropdown.html',
    controller: function() {
      this.resizeBlock = function() {
        var owl = angular.element(".owl-carousel").data('owlCarousel');
        if(this.options.type  == 'complicated') {
          angular.element('#hero-slider').addClass('block-resized');
          owl.next();
        } else {
          angular.element('#hero-slider').removeClass('block-resized');
          owl.next();
        }

      }
    }
});

