app.component('kswPassengers', {
    bindings: {
      options: '='
    },
    templateUrl: 'passengers.html',
    controller: function() {
      this.$onInit = function () {
        this.totalNum = this.options.passengers.adult + this.options.passengers.child + this.options.passengers.baby;
      }


      this.inc = function(key) {
        if(this.totalNum < 9) {
          this.options.passengers[key] += 1;
          this.totalNum += 1;
        }
      }

      this.dec = function(key) {
        if(this.options.passengers[key] !==0 ) {
          this.options.passengers[key] -= 1;
          this.totalNum -= 1;
        }
      }
    }
});


